import React from 'react';
import { NavLink } from 'react-router-dom';

const Navbar = ({ user, setUser }) => {
  const handleLogout = () => {
    setUser(null);
    localStorage.removeItem('user');
  };

  return (
    <nav className="bg-blue-600 text-white shadow-lg sticky top-0 z-50">
      <div className="container mx-auto flex justify-between items-center p-4">
        {/* Logo */}
        <NavLink to="/" className="text-2xl font-bold flex items-center">
          ðŸš— GarageShare
        </NavLink>

        {/* Links */}
        <div className="flex space-x-6">
          <NavLink
            to="/"
            className={({ isActive }) =>
              `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
            }
          >
            Inicio
          </NavLink>

          {user && (
            <>
              <NavLink
                to="/favorites"
                className={({ isActive }) =>
                  `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
                }
              >
                Favoritos
              </NavLink>

              <NavLink
                to="/user-dashboard"
                className={({ isActive }) =>
                  `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
                }
              >
                Mi Dashboard
              </NavLink>
            </>
          )}

          {user?.role?.includes('host') && (
            <>
              <NavLink
                to="/host-dashboard"
                className={({ isActive }) =>
                  `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
                }
              >
                Dashboard de AnfitriÃ³n
              </NavLink>

              <NavLink
                to="/add-space"
                className={({ isActive }) =>
                  `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
                }
              >
                Agregar Espacio
              </NavLink>
            </>
          )}

          {user && (
            <NavLink
              to="/ai-planner"
              className={({ isActive }) =>
                `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
              }
            >
              Planificador AI
            </NavLink>
          )}

          {!user ? (
            <>
              <NavLink
                to="/login"
                className={({ isActive }) =>
                  `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
                }
              >
                Iniciar SesiÃ³n
              </NavLink>
              <NavLink
                to="/register"
                className={({ isActive }) =>
                  `hover:text-gray-200 ${isActive ? 'text-yellow-300' : ''}`
                }
              >
                Registrarse
              </NavLink>
            </>
          ) : (
            <button
              onClick={handleLogout}
              className="hover:text-gray-200 text-red-500"
            >
              Cerrar SesiÃ³n
            </button>
          )}
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
